import './App.css';
import {Routes, Route} from 'react-router-dom';
//components
import Home from './components/home/home'
import ThemeContexteProvider from './hoc/darkmode/themeContext';

function App() {
  return (
    <Routes>
        <Route path="/" element={
          <Home />
        } />
    </Routes>
  );
}

export default App;
